import emailjs from "emailjs-com";


export const sendEmail = (props)=>{
    return emailjs.send(
        "service_x7a9kq",     // Service ID
        "template_abc123",    // Template ID
        {
          from_name: "Imran",
          from_email: "test@email.com",
          message: "Hello EmailJS!",
        },
        "JYdPZ8abcXYZ"        // Public Key
      );
}
